import React from 'react';
import { Link } from 'react-router-dom'; 
import imagen from '../../IMG/paginas-web-gratis-juegos-gratis-2363811.webp';

const LandingPage = () => {
  return (
    
      <div className="div-foto">
        <img src={imagen} alt="foto" />
        <div>
      <Link to="/home">
        <button>VIDEOGAMES</button>
      </Link>
      </div>
    </div>
  );
};

export default LandingPage;
